import React from 'react'
import Style from './SearchCardItem.module.css'
import { BsFillFileEarmarkFill } from "react-icons/bs";
import { useSelector, useDispatch } from "react-redux";
import { Light, Dark, Toggle, ThemeState } from "../Redux/ThemeSlice";

function SearchCardItem() {
    let pdf = {
        file: "data:application/pdf;base64,",
        file_name: "Purchase Invoice"
      }
    function downloadPDF(pdf) {
        const pdfLink = `${pdf.file}`;
        const anchorElement = document.createElement('a');
        const fileName = `${pdf.file_name}.pdf`;
        anchorElement.href = pdfLink;
        anchorElement.download = fileName;
        anchorElement.click();
    }
    const theme = useSelector(ThemeState);
  const dispatch = useDispatch();
  return (
    <div>
      <div className={theme === "Light" ? Style.card_Light : Style.card_Dark} onClick={()=>downloadPDF(pdf)}>
       <BsFillFileEarmarkFill color={theme === "Light" ? "#80AFE7" : "white"} size={60} />

       <p>
        hello.txt
       </p>

       <p style={{fontSize:"18px"}}>
        Type: text file
       </p>
     </div>
    </div>
  )
}

export default SearchCardItem
